import React from "react";
import styled from "styled-components";

const NavigationBar = styled.div`
  margin: 0;
  .nav {
    max-width: 1280px;
    margin: 0 auto;
    box-sizing: border-box;
    height: 120px;
    display: flex;
    justify-content: space-between;
    align-items: center;
    padding-left: 40px;
    padding-right: 40px;
  }
  .nav span {
    display: inline-block;
    font-size: 24px;
    color: #101010;
    font-weight: bold;
    white-space: nowrap;
  }
  .menu {
    display: flex;
    list-style: none;
    font-size: 20px;
    padding: 0;
    margin: 0;
  }
  .menu li:not(:nth-child(1)) {
    padding-left: 32px;
  }
  .menu li:nth-child(4) {
    opacity: 0.2;
  }
  .menu li a {
    text-decoration: none;
    color: #101010;
  }
  .nav_Toggle {
    position: absolute;
    right: 80px;
  }
  .nav_Toggle span {
    position: absolute;
    transition: 0.3s ease-in-out;
    height: 4px;
    width: 30px;
    border-radius: 7px;
    background-color: #3d4146;
    top: 0;
    transition: 0.3s;
  }
  .nav_Toggle span:nth-child(1) {
    top: -5px;
  }
  .nav_Toggle span:nth-child(2),
  .nav_Toggle span:nth-child(3) {
    top: 10px;
  }
  .nav_Toggle span:nth-child(4) {
    top: 20px;
  }
`;
function Navbar() {
  return (
    <NavigationBar>
      <div className="nav">
        <span>Endless Creation</span>
        <ul className="menu">
          <li>
            <a href="#">Activity</a>
          </li>
          <li>
            <a href="#">Project</a>
          </li>
          <li>
            <a href="#">Member</a>
          </li>
          <li>
            <a href="#">community</a>
          </li>
        </ul>
        <a href="#" className="nav_Toggle">
          <span></span>
          <span></span>
          <span></span>
          <span></span>
        </a>
      </div>
    </NavigationBar>
  );
}

export default Navbar;
